import { Typography } from "@mui/material";
import { useDispatch } from "react-redux";
import { addUser } from "../../slices/userSlice";
import { AddPlayerButton, AddPlayerButtonContainer, HeaderContainer } from "../../styles/header";
import font from 'https://fonts.googleapis.com/css2?family=Alegreya&display=swap';

export default function Header() {
    const dispatch = useDispatch();

    const addPlayer = () => {
        dispatch(addUser())
    }

    return (
        <HeaderContainer>
            <Typography variant="h1"
            sx={{
                fontFamily: font
            }}
            >Phase10</Typography>
            <AddPlayerButtonContainer>
                <AddPlayerButton
                    variant="contained"
                    onClick={addPlayer}>
                    Add player +
                </AddPlayerButton>
            </AddPlayerButtonContainer>
        </HeaderContainer>
    )
}
